import { useRouter } from 'next/router'

const Artikel = (props) => {

    const router = useRouter();
    const { kode } = router.query;
    let data = dummyData.find(f => f.judul == kode)
 return (
 <div className="container">
 <h1 className="title">{data.judul}</h1>
 <p>{data.isi}</p> 
 </div>
 );
}

export default Artikel;
